    return(
      <div>
        <h2 class="ui header">
          <img src={imageLink} class="ui circular image" style={{marginLeft: 10}}/>
          Patrick
          <div class="sub header">Manage your preferences</div>
        </h2>
      </div>
    );
  }
}

export default ShowBlog;
